import React from 'react';
import './nav.css';

function Nav(props) {
  const linkTitle = props.value;
  const links = linkTitle.map((number) =>
    <li>
      <a className='nav nav-link' href={number[0]}>
        {number[1]}
      </a>

        {console.log(number[1])}
    </li>
  );

  return (
    <div className="navbar">
        <ul className="1">
          {links}
          <li>
            <a className='lastly'>
            Login
            </a>
          </li>
        </ul>
      </div>
  );
}

export default Nav;
